// ==UserScript==
// @id                       iitc-plugin-portal-visited@Lin
// @name                     IITC plugin: Show portal visited beta
// @category            Layer
// @version             1.0.2
// @include             *://*.ingress.com/intel*
// @include             *://intel.ingress.com/*
// @match               *://*.ingress.com/intel*
// @match               *://intel.ingress.com/*
// @grant               none
// ==/UserScript==


function wrapper(plugin_info) {
    if(typeof window.plugin !== 'function') window.plugin = function() {};
    plugin_info.buildName = 'iitc';
    plugin_info.dateTimeVersion = '20210207.175700';
    plugin_info.pluginId = 'upcv';

    // PLUGIN START ////////////////////////////////////////////////////////
    window.plugin.upcv = function() {
    };

    window.plugin.upcv.Layers = {};
    window.plugin.upcv.upvLayerGroup = null;
    window.plugin.upcv.upcLayerGroup = null;
    window.plugin.upcv.scopeLayerGroup = null;
    window.plugin.upcv.notupvLayerGroup = null;
    window.plugin.upcv.notupcLayerGroup = null;
    window.plugin.upcv.notscopeLayerGroup = null;

    window.plugin.upcv.removeFlag = function(guid,type) {
        var previousLayer = window.plugin.upcv.Layers[guid];
        if(previousLayer){
            if (type == 1) {
                window.plugin.upcv.upvLayerGroup.removeLayer(previousLayer);
            }else if (type == 2){
                window.plugin.upcv.upcLayerGroup.removeLayer(previousLayer);
            }else if (type == 4) {
                window.plugin.upcv.scopeLayerGroup.removeLayer(previousLayer);
            }
            if (type == ~1) {
                window.plugin.upcv.notupvLayerGroup.removeLayer(previousLayer);
            }else if (type ==~2){
                window.plugin.upcv.notupcLayerGroup.removeLayer(previousLayer);
            }else if (type == ~4) {
                window.plugin.upcv.notscopeLayerGroup.removeLayer(previousLayer);
            }
            delete plugin.upcv.Layers[guid];
        }
    }

    window.plugin.upcv.addFlag = function(guid,latLng,type) {
        window.plugin.upcv.removeFlag(guid,type);
        var p = window.portals[guid];
        var iconurl = "";
        var iconSize = 25;
        var layergroup = null;
        if(type == 1){
            iconurl = "data:image/png;base64,"
            iconSize = 25;
            layergroup = plugin.upcv.upvLayerGroup;
        }
        if(type == 2){
            iconurl = "data:image/png;base64,"
            iconSize = 25;
            layergroup = plugin.upcv.upcLayerGroup;
        }
        if(type == 4){
            iconurl = "data:image/png;base64,"
            iconSize = 30;
            layergroup = plugin.upcv.scopeLayerGroup;
        }
        if(type == ~1){
            iconurl = "data:image/png;base64,"
            iconSize = 25;
            layergroup = plugin.upcv.notupvLayerGroup;
        }
        if(type == ~2){
            iconurl = "data:image/png;base64,"
            iconSize = 25;
            layergroup = plugin.upcv.notupcLayerGroup;
        }
        if(type == ~4){
            iconurl = "data:image/png;base64,"
            iconSize = 30;
            layergroup = plugin.upcv.notscopeLayerGroup;
        }

        var flag = L.marker(latLng, {
            interactive: false,
            icon: L.icon({
            iconUrl: iconurl,
            iconAnchor: [iconSize/2, iconSize/2],
            iconSize: [iconSize, iconSize],
            className: 'no-pointer-events'
            })
        });
        plugin.upcv.Layers[guid] = flag;
        flag.addTo(layergroup);
    }

    window.plugin.upcv.updatePortalFlag = function() {
        if (!map.hasLayer(window.plugin.upcv.upvLayerGroup) && 
            !map.hasLayer(window.plugin.upcv.upcLayerGroup) && 
            !map.hasLayer(window.plugin.upcv.scopeLayerGroup) && 
            !map.hasLayer(window.plugin.upcv.notupvLayerGroup) && 
            !map.hasLayer(window.plugin.upcv.notupcLayerGroup) &&
            !map.hasLayer(window.plugin.upcv.notscopeLayerGroup)) {
        return;
        }
        var showupv = false
        var showupc = false
        var showscope = false
        var shownotupv = false
        var shownotupc = false
        var shownotscope = false
        var type = 0
        if (map.hasLayer(window.plugin.upcv.upvLayerGroup)){
            showupv = true
        }
        if (map.hasLayer(window.plugin.upcv.upcLayerGroup)){
            showupc = true
        }
        if (map.hasLayer(window.plugin.upcv.scopeLayerGroup)){
            showscope = true
        }
        if (map.hasLayer(window.plugin.upcv.notupvLayerGroup)){
            shownotupv = true
        }
        if (map.hasLayer(window.plugin.upcv.notupcLayerGroup)){
            shownotupc = true
        }
        if (map.hasLayer(window.plugin.upcv.notscopeLayerGroup)){
            shownotscope = true
        }
        for (var guid in window.portals) {
            var p = window.portals[guid];
            if (p._map && p.options.data.title) {
                type = p.options.ent[2][18];

                if (showupv && type & 1) {
                    window.plugin.upcv.addFlag(guid, p.getLatLng(), 1);
                }else if(showupc && type & 2){
                    window.plugin.upcv.addFlag(guid, p.getLatLng(), 2);
                }
                if(shownotupv && (!type || (!(type & 1) && !(type & 2)))){
                    window.plugin.upcv.addFlag(guid, p.getLatLng(), ~1);
                } else if(shownotupc && !(type & 2)){
                    window.plugin.upcv.addFlag(guid, p.getLatLng(), ~2);
                }

                if (showscope && type & 4) {
                    window.plugin.upcv.addFlag(guid, p.getLatLng(), 4);
                }
                if (shownotscope && (!type || !(type & 4))) {
                    window.plugin.upcv.addFlag(guid, p.getLatLng(), ~4);
                }
            }
        }
    }

    window.plugin.upcv.delayedUpdatePortalFlag = function(wait) {
        if (window.plugin.upcv.timer === undefined) {
            window.plugin.upcv.timer = setTimeout (function() {
                window.plugin.upcv.timer = undefined;
                window.plugin.upcv.updatePortalFlag();
            }, wait*1000);
        }
    }

    window.plugin.upcv.createLayer = function() {
        window.plugin.upcv.upvLayerGroup = new L.FeatureGroup();
        window.plugin.upcv.upcLayerGroup = new L.FeatureGroup();
        window.plugin.upcv.scopeLayerGroup = new L.FeatureGroup();
        window.plugin.upcv.notupvLayerGroup = new L.FeatureGroup();
        window.plugin.upcv.notupcLayerGroup = new L.FeatureGroup();
        window.plugin.upcv.notscopeLayerGroup = new L.FeatureGroup();

        window.addLayerGroup('UPV', window.plugin.upcv.upvLayerGroup, true);
        window.addLayerGroup('UPC', window.plugin.upcv.upcLayerGroup, true);
        window.addLayerGroup('Scope Controller', window.plugin.upcv.scopeLayerGroup, true);
        window.addLayerGroup('not UPV', window.plugin.upcv.notupvLayerGroup, true);
        window.addLayerGroup('not UPC', window.plugin.upcv.notupcLayerGroup, true);
        window.addLayerGroup('not Scope Controller', window.plugin.upcv.notscopeLayerGroup, true);

        window.addHook('requestFinished', function() { setTimeout(function(){window.plugin.upcv.delayedUpdatePortalFlag(3.0);},1); });
        window.addHook('mapDataRefreshEnd', function() { window.plugin.upcv.delayedUpdatePortalFlag(0.5); });
        window.map.on('overlayadd overlayremove', function() { setTimeout(function(){window.plugin.upcv.delayedUpdatePortalFlag(1.0);},1); });
    }
    window.plugin.upcv.upv = function(data) {
        var type = data.portal.options.ent[2][18];
        if(type & 1){
            data.portal.setStyle({fillColor: 'aqua',fillOpacity: 1 });
        }
    }
    window.plugin.upcv.upc = function(data) {
        var type = data.portal.options.ent[2][18];
        if(type & 2){
            data.portal.setStyle({fillColor: 'indigo', fillOpacity: 1 });
        }
    }
    window.plugin.upcv.not_upv = function(data) {
        var type = data.portal.options.ent[2][18];
        if(type & 2){
            return
        }
        if(type & 1){
            return
        }
        else{
            data.portal.setStyle({fillColor: 'indigo', fillOpacity: 1 });
        }

    }
    window.plugin.upcv.not_upc = function(data) {
        var type = data.portal.options.ent[2][18];
        if(type & 2){
            return
        }
        if(type & 1){
            data.portal.setStyle({fillColor: 'aqua',fillOpacity: 1 });
        }
        else{
            data.portal.setStyle({fillColor: 'indigo', fillOpacity: 1 });
        }

    }
    window.plugin.upcv.scoped = function(data) {
        var type = data.portal.options.ent[2][18];
        if(type & 4){
            data.portal.setStyle({fillColor: 'yellow', fillOpacity: 1});
        }
    }
    window.plugin.upcv.not_scoped = function(data) {
        var type = data.portal.options.ent[2][18];
        if(!(type & 4)){
            data.portal.setStyle({fillColor: 'yellow', fillOpacity: 1 });
        }
    }

    var setup = function() {
        window.plugin.upcv.createLayer();
        window.addPortalHighlighter('Portal UPV', window.plugin.upcv.upv);
        window.addPortalHighlighter('Portal UPC', window.plugin.upcv.upc);
        window.addPortalHighlighter('Portal not UPV', window.plugin.upcv.not_upv);
        window.addPortalHighlighter('Portal not UPC', window.plugin.upcv.not_upc);
        window.addPortalHighlighter('Portal Scoped', window.plugin.upcv.scoped);
        window.addPortalHighlighter('Portal not Scoped', window.plugin.upcv.not_scoped);
    }
    // PLUGIN END //////////////////////////////////////////////////////////
    setup.info = plugin_info;
    if(!window.bootPlugins) window.bootPlugins = [];
    window.bootPlugins.push(setup);
    if(window.iitcLoaded && typeof setup === 'function') setup();
}
var script = document.createElement('script');
var info = {};
if (typeof GM_info !== 'undefined' && GM_info && GM_info.script) info.script = { version: GM_info.script.version, name: GM_info.script.name, description: GM_info.script.description };
script.appendChild(document.createTextNode('('+ wrapper +')('+JSON.stringify(info)+');'));
(document.body || document.head || document.documentElement).appendChild(script);